>portlet-display-template-description-arrows</Description><Description language-id=\"iw_IL\">portlet-display-template-description-arrows</Description><Description language-id=\"hu_HU\">portlet-display-template-description-arrows</Description><Description language-id=\"ja_JP\">portlet-display-template-description-arrows</Description><Description language-id=\"pt_BR\">portlet-display-template-description-arrows</Description><Description language-id=\"es_ES\">portlet-display-template-description-arrows</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',0,0,34109,NULL,NULL),('447f01a0-8a80-71c8-1d7f-4845c4bd0ebd',34111,20135,20099,20103,NULL,20103,NULL,'2019-12-30 08:23:14.542000','2019-12-30 08:23:14.542000',34106,0,34107,'BREADCRUMB-HORIZONTAL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-horizontal</Name><Name language-id=\"zh_CN\">portlet-display-template-name-horizontal</Name><Name language-id=\"nl_NL\">portlet-display-template-name-horizontal</Name><Name language-id=\"en_US\">portlet-display-template-name-horizontal</Name><Name language-id=\"fi_FI\">portlet-display-template-name-horizontal</Name><Name language-id=\"fr_FR\">portlet-display-template-name-horizontal</Name><Name language-id=\"de_DE\">portlet-display-template-name-horizontal</Name><Name language-id=\"iw_IL\">portlet-display-template-name-horizontal</Name><Name language-id=\"hu_HU\">portlet-display-template-name-horizontal</Name><Name language-id=\"ja_JP\">portlet-display-template-name-horizontal</Name><Name language-id=\"pt_BR\">portlet-display-template-name-horizontal</Name><Name language-id=\"es_ES\">portlet-display-template-name-horizontal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-horizontal</Description><Description language-id=\"zh_CN\">portlet-display-template-description-horizontal</Description><Description language-id=\"nl_NL\">portlet-display-template-description-horizontal</Description><Description language-id=\"en_US\">portlet-display-template-description-horizontal</Description><Description language-id=\"fi_FI\">portlet-display-template-description-horizontal</Description><Description language-id=\"fr_FR\">portlet-display-template-description-horizontal</Description><Descript