y.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>',0,0,34115,NULL,NULL),('dc231e70-7d90-4e1f-984a-e39a9fca8452',34121,20135,20099,20103,NULL,20103,NULL,'2019-12-30 08:23:14.938000','2019-12-30 08:23:14.938000',34120,0,34107,'RSS-NAVIGATION-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-navigation</Name><Name language-id=\"zh_CN\">portlet-display-template-name-navigation</Name><Name language-id=\"nl_NL\">portlet-display-template-name-navigation</Name><Name language-id=\"en_US\">portlet-display-template-name-navigation</Name><Name language-id=\"fi_FI\">portlet-display-template-name-navigation</Name><Name language-id=\"fr_FR\">portlet-display-template-name-navigation</Name><Name language-id=\"de_DE\">portlet-display-template-name-navigation</Name><Name language-id=\"iw_IL\">portlet-display-template-name-navigation</Name><Name language-id=\"hu_HU\">portlet-display-template-name-navigation</Name><Name language-id=\"ja_JP\">portlet-display-template-name-navigation</Name><Name language-id=\"pt_BR\">portlet-display-template-name-navigation</Name><Name language-id=\"es_ES\">portlet-display-template-name-navigation</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-navigation</Description><Description language-id=\"zh_CN\">portlet-display-template-description-navigation</Description><Description language-id=\"nl_NL\">portlet-display-template-description-navigation</Description><Description language-id=\"en_US\">portlet-display-template-description-navigation</Description><Description language-id=\"fi_FI\">portlet-display-template-description-navigation</Description><Description language-id=\"fr_FR\">portlet-display-template-description-navigation</Description><Description language-id=\"de_DE\">portlet-display-template-description-navigation</Description><Description language-id=\"iw_IL\">portlet-display-template-description-navigation</Description><Description language-id=\"hu_HU\">portlet-display-template-description-navigation</Description><Description language-id=\"ja_JP\">portlet-display-template-description-navigation</Description><Description language-id=\"pt_BR\">portlet-display-template-description-navigation</Description><Description language-id=\"es_ES\">portlet-display-template-description-navigation</Description></root>','display',NULL,'ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												iconCssClass=\"icon-calendar\"\n												label=true\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,0,34122,NULL,NULL),('b00deef8-749a-836b-dff4-b367f3cbea50',34131,20135,20099,20103,NULL,20103,NULL,'2019-12-30 08:23:15.226000','2019-12-30 08:23:15.226000',20008,0,34107,'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"zh_CN\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"nl_NL\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"en_US\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"fi_FI\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"fr_FR\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"de_DE\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"iw_IL\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"hu_HU\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"ja_JP\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"pt_BR\">portlet-display-template-name-color-by-popularity</Name><Name language-id=\"es_ES\">portlet-display-template-name-color-by-popularity</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Description language-id=\"ca_ES\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"zh_CN\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"nl_NL\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"en_US\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"fi_FI\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"fr_FR\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"de_DE\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"iw_IL\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"hu_HU\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"ja_JP\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"pt_BR\">portlet-display-template-description-color-by-popularity</Description><Description language-id=\"es_ES\">portlet-display-template-description-color-by-popularity</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class=\"tag\" href=\"${tagURL}\" style=\"color: ${color};\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,0,34132,NULL,NULL),('55647ad6-993e-9130-7415-c3fd14e38af4',34138,20135,20099,20103,NULL,20103,NULL,'2019-12-30 08:23:15.509000','2019-12-30 08:23:15.509000',34137,0,34107,'LANGUAGE-ICON-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-icon</Name><Name language-id=\"zh_CN\">portlet-display-template-name-icon</Name><Name language-id=\"nl_NL\">portlet-display-template-name-icon</Name><Name language-id=\"en_US\">portlet-dis