let-display-template-description-icon-menu</Description><Description language-id=\"es_ES\">portlet-display-template-description-icon-menu</Description></root>','ftl','<#if entries?has_content>\n	<#assign normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(languageId, \"_\", \"-\")) />\n\n	<div class=\"truncate-text\">\n		<@liferay_ui[\"icon-menu\"]\n			direction=\"left-side\"\n			icon=normalizedDefaultLanguageId\n			markupView=\"lexicon\"\n			showWhenSingleIcon=true\n			triggerLabel=normalizedDefaultLanguageId\n			triggerType=\"button\"\n		>\n			<#list entries as entry>\n				<#if !entry.isSelected() && !entry.isDisabled()>\n					<#assign\n						entryLocale = entry.getLocale()\n\n						displayName = entry.getLongDisplayName() + \"-\" + entryLocale.getDisplayCountry(entryLocale)\n						normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(entry.getLanguageId(), \"_\", \"-\"))\n					/>\n\n					<@liferay_ui[\"icon\"]\n						icon=normalizedDefaultLanguageId\n						iconCssClass=\"inline-item inline-item-before\"\n						markupView=\"lexicon\"\n						message=displayName\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>',0,20103,NULL,'2019-12-30 08:23:15.678000'),(34146,20135,20099,20103,NULL,'2019-12-30 08:23:15.875000',34137,0,34144,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,iw_IL,hu_HU,ja_JP,pt_BR,es_ES,\" default-locale=\"en_US\"><Name language-id=\"ca_ES\">portlet-display-template-name-long-text</Name><Name language-id=\"zh_CN\">portlet-display-template-name-long-text</Name><Name language-id=\"nl_NL\">portlet-display-template-name-long-text</Name><Name language-id=\"en_US\">portlet-display-template-name-long-text</Name><Name language-id=\"fi_FI\">portlet-display-template-name-long-text</Name><Name language-id=\"fr_FR\">portlet-display-template-name-long-text</Name><Name language-id=\"de_DE\">portlet-display-template-name-long