3e445b1-e330-00b2-9f27-8404246d8f9c',29007,20099,0,NULL,'2019-12-30 08:17:07.715000','2019-12-30 08:17:07.715000',110186324,'Liferay CE Portlet Dependency Factory','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay CE bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110186329','1.0.0',1),('f148907e-15c3-9a0c-a328-17bc8e8ff078',29009,20099,0,NULL,'2019-12-30 08:19:13.921000','2019-12-30 08:19:13.921000',106190999,'Liferay CE Portal Security','Liferay CE','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191003','1.0.0',1),('833dc755-3185-d9bb-b642-5c4d5019d2ca',29020,20099,0,NULL,'2019-12-30 08:19:11.027000','2019-12-30 08:19:11.027000',106191064,'Liferay CE Security SSO','Liferay CE','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191068','1.0.0',1),('861a9967-6bab-0b99-15f1-063aab9ce0e0',29037,20099,0,NULL,'2019-12-30 08:18:32.329000','2019-12-30 08:18:32.329000',74878779,'Liferay CE Static','The Static app contains an important group of extenders and utilities that Liferay statically installs before installing any dynamic OSGi modules. The app\'s functionality includes a log4j extender, an OSGi WAB extender, configuration utilities, OSGi deployment utilities, target platform indexing, and more.This suite is available in the Liferay CE bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110718095','7.1.0',1),('02180bba-dc4e-1dcd-c519-45a7bd129715',29087,20099,0,NULL,'2019-12-30 08:17:16.821000','2019-12-30 08:17:16.821000',108268021,'Liferay CE Portal Validation','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay CE bundle.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/108268026','1.0.0',1),('fc092d31-0946-8c00-aa1a-8d11a781dae2',29089,20099,0,NULL,'2019-12-30 08:17:54.685000','2019-12-30 08:17:54.685000',25019275,'Liferay Marketplace','Liferay Marketplace is an integral part of the Liferay platform experience for all users. Enterprise subscribers also have exclusive access to Liferay Subscription Apps through the Liferay Marketplace. Log in with your Liferay account to browse hundreds of apps to help you build your business or technical solution.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110879471','9',1),('a12ad517-ffb4-e66a-9aee-09bc39767e95',29094,20099,0,NULL,'2019-12-30 08:17:26.807000','2019-12-30 08:17:26.807000',103226467,'Liferay CE Adaptive Media','The Adaptive Media app tailors media in your portal to the device consuming it. Since users often consume media on multiple devices that have different screen sizes and capabilities, you should make sure that your portal presents that media in a manner suitable for each device. For example, portal administrators can configure the Adaptive Media app to send high-res images to high-res devices, low-res images to low-res devices, and so on. This ensures that your users have the best possible experience when consuming media from your portal, regardless of the device they use.Note that at this time, the Adaptive Media app only works with images in Documents and Media, Blogs, and Web Content.Once installed, the Adaptive Media app appears in the Control Panel, under the Configuration menu.Please see the documentation for special installation instructions on Liferay Portal 7.0 CE GA5.','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110380277','2.0.0',0),('acb167e9-fc6c-23fe-9de3-498c45d7163d',29123,20099,0,NULL,'2019-12-30 08:17:26.474000','2019-12-30 08:17:26.474000',106176819,'Liferay CE Announcements','Liferay CE Announcements','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106176823','1.0.0',1),('72488082-56fb-ff5d-0bbb-e0124d9d0f96',29128,20099,0,NULL,'2019-12-30 08:17:24.248000','2019-12-30 08:17:24.248000',106191590,'Liferay CE Asset','Liferay CE','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106191594','1.0.0',1),('a0c20618-1a42-6d06-f8f6-04b1b7b7a2d0',29164,20099,0,NULL,'2019-12-30 08:18:36.618000','2019-12-30 08:18:36.618000',106186042,'Liferay CE Upload','Liferay CE','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106186046','1.0.0',1),('d4d4581c-574a-bb81-16dc-61126c05d40c',29167,20099,0,NULL,'2019-12-30 08:17:34.762000','2019-12-30 08:17:34.762000',106186172,'Liferay CE Dynamic Data Lists','Liferay CE','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106186176','1.0.0',1),('2c260cc8-910e-74c5-5d33-70f9299eea91',29206,20099,0,NULL,'2019-12-30 08:17:26.407000','2019-12-30 08:17:26.407000',106190054,'Liferay CE Microsoft Translator','Liferay CE','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106190059','1.0.0',1),('87224f89-2a51-6d01-fb0c-82191040d605',29240,20099,0,NULL,'2019-12-30 08:18:58.710000','2019-12-30 08:18:58.710000',106190479,'Liferay CE Portal Background Task','Liferay CE','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106190483','1.0.0',1),('e9b59101-54f4-e47c-9835-fb5d880ae359',29244,20099,0,NULL,'2019-12-30 08:17:49.600000','2019-12-30 08:17:49.600000',106177105,'Liferay CE Blogs','Liferay CE Blogs','Communication','https://web.liferay.com/web/guest/marketplace/-/mp/asset/i