ource files written in Markdown, so you can work on them offline before publishing. Its integration with GitHub allows you to give users access to contribute fixes or improvements to articles. It\'s easy to set up the knowledge base with a workflow that requires articles to be approved before they are published. Additionally, it allows administrators to create article templates. Templates can be used to ensure that certain kinds of articles possess a common structure and include certain kinds of information. Knowledge base articles can be categorized to make them easy to find. They can also be organized hierarchically to form complete books or guides. There are multiple portlets included in this app.This app will appear in your Application menu and Site Administration once installed.','Productivity','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/110878777','4.0.0',0),('33d7490e-ab1a-fc12-9ede-db90adf22620',29506,20099,0,NULL,'2019-12-30 08:17:57.882000','2019-12-30 08:17:57.882000',106189537,'Liferay CE Expando','Liferay CE','Utility','https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/106189541','1.0.0',1),('5de84129-ca52-8e68-76d3-749d4e81be1f',29517,20099,0,NULL,'2019-12-30 08:18:48.331000','2019-12-30 08:18:48.331000',108267954,'Liferay CE Changeset','Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The au